import  React from 'react'
import RecipeCard from './RecipeCard';
import Loading from './Loading';
import useFetch from './Utils/Fetch';

function HomeRecipes() 
{

  const {data, loading} = useFetch({'url': 'https://api.spoonacular.com/recipes/random?number=150&apiKey=fa37f0fee335472a906bdc5a0cb4c3a8'});

  return (
    <div className={''}>
      <div className={''}>
          <div className={'row row-cols-4 g-2'}>
              {
                  loading  ? <Loading/> : data.map( rec => {
                      return (
                              <RecipeCard key={rec.id} id={rec.id} title={rec.title} summary={rec.summary} cheap={rec.cheap} diets={rec.diets} image={rec.image} />
                      )
                    }
                  )
              } 
            </div>
      </div>
    </div>
  )
}



export default HomeRecipes
